        public static List<string> obtainVocabulary(string cefr, string level)
        {
            List<string> sended = new List<string> { };
            
            switch (cefr)
            {
                case "A1":
                    sended = ObtainWords(a1, level, 30);
                    break;
                case "A2":
                    sended = ObtainWords(a2, level, 29);
                    break;
                case "B1":
                    sended = ObtainWords(b1, level, 27);
                    break;
                case "B2 (1)":
                    sended = ObtainWords(b2_1, level, 24);
                    break;
                case "B2 (2)":
                    sended = ObtainWords(b2_2, level, 24);
                    break;
                case "C1":
                    sended = ObtainWords(c1, level, 44);
                    break;
                default:
                    break;
            }

            return sended;
        }

        public static List<string> ObtainWords(List<string> lista, string level, int verbOnList)
        {

            int valor = Int32.Parse(level);

            List<string> wordList = new List<string> { };
            List<string> randomWords = new List<string> { };

            for (int i = 0; i < lista.Count; i++)
            {
                if (valor < lista.Count)
                {
                    wordList.Add(lista[valor]);
                    valor += verbOnList;
                }
            }

            var randomize = wordList.OrderBy(i => Guid.NewGuid());
            foreach (var word in randomize)
            {
                randomWords.Add(word);
            }

            return randomWords;
        }
    }
